import planet1IMG from '../imgs/planet1.png';


function drawPlanet(){
    var canvas = document.getElementById("Maincanvas");
    var ctx = canvas.getContext('2d');        
    
    ctx.drawImage(planet1IMG, 10, 10);







    
}

